        value: |-
          Alice Walker's four-part definition of a womanist portrays the complexity of "being" and "doing" as a womanist.  This panel will discuss the affiliations
          and involvement of African American women in religious communities (the Nation of Islam, the Moorish Science Temple, black churches) and social movements (Civil Rights Movement) to liberate the African American community.  Particular attention will be given to loyalties, solidarities,
          moral norms, and the challenges of being a womanist doing activism, while posing questions about future activism.
